import React from "react";
import "./App.css";
import CustomForm from "./components/CustomForm/CustomForm";
import CustomHeader from "./components/CustomHeader/CustomHeader";

const App = () => {
  return (
    <div className='App'>
      <header className='App-header'>
        <CustomHeader height={20}>
          <h1>hahah</h1>
        </CustomHeader>
        <CustomForm />
      </header>
    </div>
  );
};

export default App;
